sys_variable_value.value:
(function execute(inputs, outputs) {
if(inputs['statusCode'] == '200' && inputs['responseBody']){

var responseObj = JSON.parse(inputs['responseBody']);
var responseData = responseObj.data;

for(var i = 0; i<responseData.length; i++){
   var cryptoId = responseData[i].id;
   var cryptoName = responseData[i].name;
   var cryptoSymbol = responseData[i].symbol;
   var cryptoPrice = responseData[i].quote.INR.price;

 var gr = new GlideRecord('x_350882_cryptonow_crypto_listings');
  gr.addQuery('id',cryptoId);
  gr.query();
  if(gr.next()){
    gr.name = cryptoName;
    gr.symbol = cryptoSymbol;
    gr.price = cryptoPrice >= 1 ? parseFloat(cryptoPrice).toFixed(2) : parseFloat(cryptoPrice).toFixed(6);
    gr.update();
    outputs['tableaction'] = 'update';
  }
  else{
     gr.initialize();
     gr.id = cryptoId;
     gr.name = cryptoName;
     gr.symbol = cryptoSymbol;
     gr.price = cryptoPrice >= 1 ? parseFloat(cryptoPrice).toFixed(2) : parseFloat(cryptoPrice).toFixed(6);
     gr.insert();
    outputs['tableaction'] = 'insert';
  }

}


}
  else{
      outputs['errorcode'] = responseObj.errorCode;
      outputs['errormessage'] = responseObj.errorMessage;
  }
})(inputs, outputs);

